def get_yahoo_player(playerid, first_name=None, last_name=None):
    try:
        if not playerid:
            raise Exception
        player = Lookup.from_fangraphs_ids((playerid,))
        yahoo_id_row = player.iloc[0]
        yahoo_id_col = yahoo_id_row['yahoo_id']
        return int(yahoo_id_col)
    except Exception as e:
        if not first_name or not last_name:
            return

        from players.models import BaseballPlayer
        baseball_player = BaseballPlayer.objects.filter(
            first_name__unaccent__icontains=first_name,
            last_name__unaccent__icontains=last_name).first()
        if not baseball_player:
            return
        return int(baseball_player.remote_player_id)

